visto:

que desde 2015 estamos atravesando una nueva y poderosa ola feminista global, a distintos ritmos pero con expresiones en todo el mundo;

que ya en 2017 y 2018 se han realizado paros internacionales de mujeres, con importantes movilizaciones y acciones en decenas de pa√≠ses;

que as√≠, en un avance respecto de las anteriores, esta nueva ola ha incorporado como propio el m√©todo de lucha caracter√≠stico de la clase trabajadora: la huelga;

y considerando:

que nuestros partidos y grupos tienen al movimiento feminista y disidente como un frente destacado de intervenci√≥n y de construcci√≥n, en varios casos como juntas y a la izquierda;

que en dicho movimiento, si bien act√∫an distintas corrientes, no hay aparatos consolidados que hegemonicen su conducci√≥n, lo cual nos deja mayor espacio;

que la preparaci√≥n y el evento mismo del pr√≥ximo 8m constituyen una gran oportunidad pol√≠tica para aprovechar con toda audacia;

